{"content": "\u501f\u8d37\u5df2\u6210\u4e3a\u4e0d\u5bb9\u5ffd\u89c6\u7684\u5927\u95ee\u9898\uff0c\u5404\u79cd\u66b4\u529b\u4e8b\u4ef6\uff0c\u81ea\u6740\u4e8b\u4ef6\u9891\u51fa\u3002", "text": "\u501f\u8d37\u5df2\u6210\u4e3a\u4e0d\u5bb9\u5ffd\u89c6\u7684\u5927\u95ee\u9898\uff0c\u5404\u79cd\u66b4\u529b\u4e8b\u4ef6\uff0c\u81ea\u6740\u4e8b\u4ef6\u9891\u51fa\u3002", "news_id": "weibo", "id": 77, "timestamp": 42837}
