{"content": "\u5e94\u8be5\u662f\u4e0d\u5f97\u5411\u6ca1\u6709\u56fa\u5b9a\u6536\u5165\u7684\u5f53\u4e8b\u4eba\u653e\u8d37\uff0c\u8fd9\u662f\u4fe1\u8d37\u8d77\u7801\u7684\u89c4\u5219\u3002\u8fdd\u80cc\u4e86\u8fd9\u4e00\u6761\uff0c\u5c31\u662f\u6572\u8bc8\u4e86\u3002\u540c\u65f6\uff0c\u6cd5\u9662\u8981\u5c0a\u91cd\u9ad8\u6cd5\u7684\u91ca\u6cd5\uff0c\u57fa\u51c6\u5229\u7387\u56db\u500d\u4ee5\u4e0a\u6c11\u95f4\u501f\u8d37\u4e0d\u53d7\u6cd5\u5f8b\u4fdd\u62a4\u3002", "text": "\u5e94\u8be5\u662f\u4e0d\u5f97\u5411\u6ca1\u6709\u56fa\u5b9a\u6536\u5165\u7684\u5f53\u4e8b\u4eba\u653e\u8d37\uff0c\u8fd9\u662f\u4fe1\u8d37\u8d77\u7801\u7684\u89c4\u5219\u3002\u8fdd\u80cc\u4e86\u8fd9\u4e00\u6761\uff0c\u5c31\u662f\u6572\u8bc8\u4e86\u3002\u540c\u65f6\uff0c\u6cd5\u9662\u8981\u5c0a\u91cd\u9ad8\u6cd5\u7684\u91ca\u6cd5\uff0c\u57fa\u51c6\u5229\u7387\u56db\u500d\u4ee5\u4e0a\u6c11\u95f4\u501f\u8d37\u4e0d\u53d7\u6cd5\u5f8b\u4fdd\u62a4\u3002", "news_id": "weibo", "id": 144, "timestamp": 42837}
