{"content": "\u9ad8\u5229\u8d37\u4e3a\u4ec0\u4e48\u8fd9\u4e48\u591a\uff0c\u5176\u4e00\u5c31\u662f\u5229\u6da6\u9ad8\u5f97\u9ed1\u4eba\uff0c\u6bd4\u5e72\u5b9e\u4f53\u5f3aN\u591a\u500d\u3002\u5176\u4e8c\u5c31\u662f\u65e0\u98ce\u9669(\u627e\u50ac\u6b3e\u516c\u53f8\u6536\u94b1)\u3002\u56fd\u5bb6\u5e94\u4e25\u683c\u7ba1\u7406\u9ad8\u5229\u8d37\uff0c\u53ea\u9700\u8ba9\u4ed6\u4eec\u7684\u5229\u6da6\u548c\u98ce\u9669\u6210\u6b63\u6bd4\u5c31\u53ef\u4ee5\u4e86\uff0c\u5426\u52190\u98ce\u9669\u7684\u9ad8\u5229\u8d37\uff0c\u4f1a\u5168\u56fd\u5230\u5904\u90fd\u662f\u3002", "text": "\u9ad8\u5229\u8d37\u4e3a\u4ec0\u4e48\u8fd9\u4e48\u591a\uff0c\u5176\u4e00\u5c31\u662f\u5229\u6da6\u9ad8\u5f97\u9ed1\u4eba\uff0c\u6bd4\u5e72\u5b9e\u4f53\u5f3aN\u591a\u500d\u3002\u5176\u4e8c\u5c31\u662f\u65e0\u98ce\u9669(\u627e\u50ac\u6b3e\u516c\u53f8\u6536\u94b1)\u3002\u56fd\u5bb6\u5e94\u4e25\u683c\u7ba1\u7406\u9ad8\u5229\u8d37\uff0c\u53ea\u9700\u8ba9\u4ed6\u4eec\u7684\u5229\u6da6\u548c\u98ce\u9669\u6210\u6b63\u6bd4\u5c31\u53ef\u4ee5\u4e86\uff0c\u5426\u52190\u98ce\u9669\u7684\u9ad8\u5229\u8d37\uff0c\u4f1a\u5168\u56fd\u5230\u5904\u90fd\u662f\u3002", "news_id": "weibo", "id": 154, "timestamp": 42837}
