{"content": "\u73b0\u5728\u6fc0\u7d20\u5bfc\u81f4\u9752\u5c11\u5e74\u6210\u957f\u8fc7\u5feb\uff0c\u4f20\u7edf\u7684\u6559\u80b2\u53c8\u6ca1\u6709\u8ddf\u4e0a\u89e3\u51b3\u8fd9\u4e2a\u6210\u957f\u8fc7\u5feb\u5bfc\u81f4\u7684\u95ee\u9898\uff0c\u5bfc\u81f4\u4e00\u90e8\u5206\u4eba\u5229\u7528\u9752\u5c11\u5e74\u5728\u4e92\u8054\u7f51\u91d1\u878d\u9677\u9631\u9762\u524d\u65e0\u8fa8\u522b\u80fd\u529b\u7684\u673a\u4f1a\u53d1\u9ed1\u5fc3\u8d22\uff0c\u8c01\u90fd\u6709\u8d23\u4efb\uff0c\u8c01\u90fd\u9003\u8131\u4e0d\u4e86\u3002", "text": "\u73b0\u5728\u6fc0\u7d20\u5bfc\u81f4\u9752\u5c11\u5e74\u6210\u957f\u8fc7\u5feb\uff0c\u4f20\u7edf\u7684\u6559\u80b2\u53c8\u6ca1\u6709\u8ddf\u4e0a\u89e3\u51b3\u8fd9\u4e2a\u6210\u957f\u8fc7\u5feb\u5bfc\u81f4\u7684\u95ee\u9898\uff0c\u5bfc\u81f4\u4e00\u90e8\u5206\u4eba\u5229\u7528\u9752\u5c11\u5e74\u5728\u4e92\u8054\u7f51\u91d1\u878d\u9677\u9631\u9762\u524d\u65e0\u8fa8\u522b\u80fd\u529b\u7684\u673a\u4f1a\u53d1\u9ed1\u5fc3\u8d22\uff0c\u8c01\u90fd\u6709\u8d23\u4efb\uff0c\u8c01\u90fd\u9003\u8131\u4e0d\u4e86\u3002", "news_id": "weibo", "id": 530, "timestamp": 42837}
