{"content": "\u73b0\u5728\u652f\u4ed8\u5b9d\u5fae\u4fe1\u597d\u591a\u90fd\u53ef\u4ee5\u501f\u6b3e\uff0c\u5229\u606f\u4f4e\uff0c\u5c31\u7b97\u60f3\u501f\u94b1\u4e5f\u6ca1\u5fc5\u8981\u7528\u88f8\u6761\u5427\uff0c5000\u5b9e\u9645\u5230\u624b2750\uff0c\u81ea\u5df1\u6ca1\u70b9\u8111\u5b50\u53c8\u80fd\u602a\u8c01\u5462\uff0c\u4f46\u8bf4\u6b63\u7ecf\u7684\u8fd9\u79cd\u9ad8\u5229\u8d37\u56fd\u5bb6\u5e94\u5f53\u4e25\u5389\u6253\u51fb\u3002", "text": "\u73b0\u5728\u652f\u4ed8\u5b9d\u5fae\u4fe1\u597d\u591a\u90fd\u53ef\u4ee5\u501f\u6b3e\uff0c\u5229\u606f\u4f4e\uff0c\u5c31\u7b97\u60f3\u501f\u94b1\u4e5f\u6ca1\u5fc5\u8981\u7528\u88f8\u6761\u5427\uff0c5000\u5b9e\u9645\u5230\u624b2750\uff0c\u81ea\u5df1\u6ca1\u70b9\u8111\u5b50\u53c8\u80fd\u602a\u8c01\u5462\uff0c\u4f46\u8bf4\u6b63\u7ecf\u7684\u8fd9\u79cd\u9ad8\u5229\u8d37\u56fd\u5bb6\u5e94\u5f53\u4e25\u5389\u6253\u51fb\u3002", "news_id": "weibo", "id": 1223, "timestamp": 42836}
