{"content": "\u6bcf\u4e2a\u6708\u6536\u51656000\u591a\u7b97\u4e0d\u9519\u7684\u4e86\u5427\uff1f\u6bcf\u4e2a\u67081000\u8fd8\u4e0d\u591f\u82b1\uff1f\u6211TM\u518d\u4e0a\u6d77\u4e00\u4e2a\u6708\u5403\u7684\u597d\u73a9\u7684\u597d\u8fd8\u5b9a\u65f6\u4e70\u8863\u670d\u4e70\u62a4\u80a4\u54c1\u6ee1\u6253\u6ee1\u7b97\u4e5f\u4e0d\u8d85\u8fc7800\u3002\u7528\u94b1\u4e0d\u7b97\u90a3\u5c31\u662f\u70e7\u94b1\u554a", "text": "\u6bcf\u4e2a\u6708\u6536\u51656000\u591a\u7b97\u4e0d\u9519\u7684\u4e86\u5427\uff1f\u6bcf\u4e2a\u67081000\u8fd8\u4e0d\u591f\u82b1\uff1f\u6211TM\u518d\u4e0a\u6d77\u4e00\u4e2a\u6708\u5403\u7684\u597d\u73a9\u7684\u597d\u8fd8\u5b9a\u65f6\u4e70\u8863\u670d\u4e70\u62a4\u80a4\u54c1\u6ee1\u6253\u6ee1\u7b97\u4e5f\u4e0d\u8d85\u8fc7800\u3002\u7528\u94b1\u4e0d\u7b97\u90a3\u5c31\u662f\u70e7\u94b1\u554a", "news_id": "weibo", "id": 1231, "timestamp": 42836}
