{"content": "\u53d1\u4e2a\u901a\u77e5\u6709\u7528\u5417 \u4e0d\u5982\u544a\u8bc9\u5b66\u751f \u4f60\u4eec\u53ea\u7ba1\u5927\u80c6\u501f \u501f\u4e86\u4e0d\u7528\u8fd8 \u6709\u4eba\u6765\u8981\u5e10 \u4f60\u5c31\u62a5\u8b66\u8d77\u8bc9 \u56fd\u5bb6\u65e0\u6761\u4ef6\u652f\u6301\u5b66\u751f\u8d56\u8d26 \u6765\u6cbb\u7406\u8fd9\u4e9b\u793e\u4f1a\u8001\u9ad8\u4ece\u4e1a\u8005 \u8ba9\u4ed6\u4eec\u8840\u672c\u65e0\u5f52 \u81ea\u7136\u6ca1\u4eba\u5411\u5b66\u751f\u4e0b\u624b \u5f53\u7136 \u81ea\u613f\u8131\u5149 \u7684\u5b66\u751f\u90a3\u662f\u81ea\u5df1\u505a\u6b7b", "text": "\u53d1\u4e2a\u901a\u77e5\u6709\u7528\u5417 \u4e0d\u5982\u544a\u8bc9\u5b66\u751f \u4f60\u4eec\u53ea\u7ba1\u5927\u80c6\u501f \u501f\u4e86\u4e0d\u7528\u8fd8 \u6709\u4eba\u6765\u8981\u5e10 \u4f60\u5c31\u62a5\u8b66\u8d77\u8bc9 \u56fd\u5bb6\u65e0\u6761\u4ef6\u652f\u6301\u5b66\u751f\u8d56\u8d26 \u6765\u6cbb\u7406\u8fd9\u4e9b\u793e\u4f1a\u8001\u9ad8\u4ece\u4e1a\u8005 \u8ba9\u4ed6\u4eec\u8840\u672c\u65e0\u5f52 \u81ea\u7136\u6ca1\u4eba\u5411\u5b66\u751f\u4e0b\u624b \u5f53\u7136 \u81ea\u613f\u8131\u5149 \u7684\u5b66\u751f\u90a3\u662f\u81ea\u5df1\u505a\u6b7b", "news_id": "weibo", "id": 1402, "timestamp": 42836}
