{"content": "\u4eb2\u4eb2\u670b\u53cb\u90fd\u95e8\u8def\u5bbd\u3002\u6211\u7528\u73b0\u5b9e\uff0c\u4e07\u4eba\u53e3\u676f\u4e0a\u8bbf\u3002\u6211\u8bc1\u636e\u3002\u4ed6\u4eec\u725b\u903c\u5356\u5047\u6c34\u6253\u4eba\uff0c\u5bb3\u4eba\u574f\u4e8b\u505a\u5c3d\u7684\u4eba\u597d\u4e0d\u90a3\u91cc\u53bb\u3002\u8fdf\u65e9\u4e0a\u5929\u90fd\u6454\u8ddf\u5934\u7684\u3002\u4e0d\u6b63\u4ec0\u4e48\u5e72\u4e0d\u6210\uff0c\u8001\u5929\u7237\u4e0d\u6ce8\u4ed6\u3002", "text": "\u4eb2\u4eb2\u670b\u53cb\u90fd\u95e8\u8def\u5bbd\u3002\u6211\u7528\u73b0\u5b9e\uff0c\u4e07\u4eba\u53e3\u676f\u4e0a\u8bbf\u3002\u6211\u8bc1\u636e\u3002\u4ed6\u4eec\u725b\u903c\u5356\u5047\u6c34\u6253\u4eba\uff0c\u5bb3\u4eba\u574f\u4e8b\u505a\u5c3d\u7684\u4eba\u597d\u4e0d\u90a3\u91cc\u53bb\u3002\u8fdf\u65e9\u4e0a\u5929\u90fd\u6454\u8ddf\u5934\u7684\u3002\u4e0d\u6b63\u4ec0\u4e48\u5e72\u4e0d\u6210\uff0c\u8001\u5929\u7237\u4e0d\u6ce8\u4ed6\u3002", "news_id": "weibo", "id": 1979, "timestamp": 42838}
