{"content": "\u623f\u5b50\u9762\u79ef3269\u3007\u6bcf\u5e73\u7c73\u7684\u8bdd,\u571f\u5730\u6240\u6709\u9762\u79ef\u5e94\u4e0d\u4f4e\u4e8e3269\u767e\u5757\u6bcf\u5e73\u7c73\u3002\u53d1\u5c55\u7ed3\u679c\u662f\u6bcf\u4f4d\u56fd\u6c11\u4e22\u5931\u571f\u5730\u6240\u6709\u6743\uff0c\u571f\u5730\u9762\u79ef\u8d8a\u6765\u8d8a\u5c0f\u3002\u571f\u5730\u6362\u6237\u7c4d\u548c\u6237\u7c4d\u6362\u571f\u5730\u76f8\u5bf9\u53ef\u884c\u3002\u571f\u5730\u6240\u6709\u6743\u5c5e\u4e8e\u5168\u56fd\u4eba\u6c11\uff0c\u6ca1\u6709\u505a\u597d\u571f\u5730\u6240\u6709\u6743\u7684\u4ee3\u7406\u4eba\uff0c\u4e00\u4e9b\u4eba\u901a\u8fc7\u5077\u6362\u6982\u5ff5\u6216\u4fee\u6539\u571f\u5730\u6cd5\u89c4\u8fdb\u884c\u7684\u76c8\u5229\u53ef\u7528\u4e07\u4ebf\u8ba1\u91cf\uff0c\u6574\u4e2a\u8fc7\u7a0b\u65f6\u95f4\u8de8\u5ea6\u4e5f\u4f1a\u8f83\u957f\uff01", "text": "\u623f\u5b50\u9762\u79ef3269\u3007\u6bcf\u5e73\u7c73\u7684\u8bdd,\u571f\u5730\u6240\u6709\u9762\u79ef\u5e94\u4e0d\u4f4e\u4e8e3269\u767e\u5757\u6bcf\u5e73\u7c73\u3002\u53d1\u5c55\u7ed3\u679c\u662f\u6bcf\u4f4d\u56fd\u6c11\u4e22\u5931\u571f\u5730\u6240\u6709\u6743\uff0c\u571f\u5730\u9762\u79ef\u8d8a\u6765\u8d8a\u5c0f\u3002\u571f\u5730\u6362\u6237\u7c4d\u548c\u6237\u7c4d\u6362\u571f\u5730\u76f8\u5bf9\u53ef\u884c\u3002\u571f\u5730\u6240\u6709\u6743\u5c5e\u4e8e\u5168\u56fd\u4eba\u6c11\uff0c\u6ca1\u6709\u505a\u597d\u571f\u5730\u6240\u6709\u6743\u7684\u4ee3\u7406\u4eba\uff0c\u4e00\u4e9b\u4eba\u901a\u8fc7\u5077\u6362\u6982\u5ff5\u6216\u4fee\u6539\u571f\u5730\u6cd5\u89c4\u8fdb\u884c\u7684\u76c8\u5229\u53ef\u7528\u4e07\u4ebf\u8ba1\u91cf\uff0c\u6574\u4e2a\u8fc7\u7a0b\u65f6\u95f4\u8de8\u5ea6\u4e5f\u4f1a\u8f83\u957f\uff01", "news_id": "weibo", "id": 3312, "timestamp": 42835}
